    const newMovies = useFetch(`${URL_API}/movie/now_playing?api_key=${API}&language=en-ES&page=1`)
    console.log(newMovies);
    return (
        <React.Fragment>
            <SliderMovies movies={newMovies} />
        </React.Fragment>
    )
}
